import { Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="bg-blend-lighten hover:bg-blend-darken">
       <div className="bg-gradient-to-r from-green-400 to-blue-500 p-6 rounded-lg shadow-xl">
         <ul className="space-y-4 flex flex-row justify-evenly">
            <li className="text-2xl font-bold hover:scale-100 hover:cursor-pointer">
              <Link to="/">Home</Link>
            </li>
           <li className="text-2xl font-bold hover:scale-100  hover:cursor-pointer">
              <Link to="/services">Services</Link>
           </li>
           <li className="text-2xl font-bold hover:scale-100  hover:cursor-pointer">
              <Link to="/projects">Projects</Link>
           </li>
            <li className="text-2xl font-bold hover:scale-100 hover:cursor-pointer">
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
      </div>
    </div>
  );
}

export default App;
